# after _Mikhail Kurkov_, based on an algorithm of _Peter Bala_, cf. link in A110501.
def euler_list(len: int) -> list[int]:
    if len == 0: return []
    v1 = [1] + [0] * (len - 1)
    v2 = [i**2 for i in range(1, len + 1)]
    result = [0] * len
    result[0] = 1
    for i in range(1, len):
        for j in range(1, i):
            v1[j] += v2[i - j] * v1[j - 1]
        v1[i] = v1[i - 1]
        result[i] = v1[i]
    return result
